import React from "react";
import {Link} from 'react-router-dom';
import { Form } from "react-bootstrap";
import HospitalService from '../services/HospitalService';

import axios from "axios";
class AddHospital extends React.Component{

    constructor(props){
        super(props);
        this.state= this.initiaLSTATE;
        this.state={};
    }
    
    listHospital(){
        return this.props.history.push("/list");
    }

    initiaLSTATE={
        id:"",
        name:"",
        number:"",
        location:"",
        pincode:"",
       

    };
    handlesubmit= (event) => {
       
        const hospital ={
            name:this.state.name,
            number:this.state.number,
            location:this.state.location,
            pincode:this.state.pincode
           
        }
        HospitalService.createHospital(hospital).then(res =>{
          this.props.history.push('/');
      });
        // axios.post("http://localhost:8080/api/hospitals",hospital).then(response => {
        //     alert("hospital saved");
        //  })
    }
       
    hospitalChange = (event) => {
        this.setState({
          [event.target.name]: event.target.value,
        });
      };
    render(){
        
        
        return(
        <Form onSubmit={this.handlesubmit} >
            <div className="main">
            <div >
              <div>
                <div>
                  <h1>Insert Hospital</h1>
                  <div>
                    
                    <input type="text" placeholder="name" className="name" pattern="[A-Za-z]{5,10}" name="name" value={this.state.name} onChange={this.hospitalChange} required/>
                  </div>
                  <div className="second-input">
                  
                  <input type="text" placeholder="Contact number" className="number"  name="number" value={this.state.number} onChange={this.hospitalChange} required/>
                </div>
                  <div className="second-input">
                  
                    <input type="text" placeholder="Hospital Location" className="location"  value={this.state.location}  name="location" onChange={this.hospitalChange} required/>
                  </div>
                  
                  <div className="second-input">
                  
                    <input type="text" placeholder="Hospital Pincode" className="pincode" name="pincode" pattern="[0-9]{6}"  value={this.state.pincode} onChange={this.hospitalChange} required/>
                  </div>
                  
               
                
                 
                 <div className="login-button">
                 <button  >submit</button><br></br>
                 <br></br>
                 <button ><Link to={"/list"}>List</Link></button>
                 </div>
                
                 </div>
                </div>
              
             
       
            </div>
           </div> 
           </Form>
           
        );
    }
}

export default AddHospital;
